import "./App.css";
import Search from "./components/Search";
import { useState } from "react";
import Results from "./components/Results";
import usePhotoSearch from "./components/usePhotoSearch";

function App() {
  const [photos] = usePhotoSearch();
  return (
    <div className="App">
      <Search />
      <Results photo={photos} />
    </div>
  );
}

export default App;
